import React from "react";
import "./style.css";

function Coding() {
  return (
    <div>
      <div class="row ml-4 mr-4 mb-4">
        <div class="col-sm-12 col-md-6 col-lg-6 col-xl-6 justify-content-sm-center">
          <div class="wrapper position-relative mb-4">
            <a href="https://github.com/eurbaezjr">
              <img className="img-fluid" id="coding-image"
                src="https://www.imagesysit.com/images/easyblog_shared/November_2018/11-5-18/learning_code_400.jpg"
                alt="Audio Engineering" />
              <div className="box-1 position-absolute">Ad-Tech Experience</div>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Coding;
